import logo from './logo.svg';
import './App.css';
import Home from "./views/Home/Home"

const { google } = require('googleapis');
const credentials = require('./claves/ort-project-354900-dbaed0423a37.json');

// Crea un nuevo cliente de autenticación
const auth = new google.auth.GoogleAuth({
  credentials,
  scopes: ['https://www.googleapis.com/auth/spreadsheets'],
});

// Crea un cliente de la API de Google Sheets
const sheets = google.sheets({ version: 'v4', auth });


async function getSheetData() {
  try {
    const response = await sheets.spreadsheets.values.get({
      spreadsheetId: '812508952',
      range: 'ALMAGRO 2023-2!A1:B5',
    });
    const values = response.data.values;
    console.log('Valores obtenidos:', values);
  } catch (error) {
    console.error('Error al obtener los valores:', error);
  }
}

getSheetData();


function App() {
  return (
    <div className="App">
      <Home/>
    </div>
  );
}

export default App;
